import React from 'react'

function Home() {
  return (
   <div>

  <div id="demo" className="carousel slide" data-bs-ride="carousel">
   
    <div className="carousel-indicators">
      <button type="button" data-bs-target="#demo" data-bs-slide-to={0} className="active" />
      <button type="button" data-bs-target="#demo" data-bs-slide-to={1} />
      <button type="button" data-bs-target="#demo" data-bs-slide-to={2} />
    </div>

    <div className="carousel-inner">
      <div className="carousel-item active">
        <img src="data:image/jpeg;base64," alt="Los Angeles" className="d-block" style={{width: '100%'}} />
      </div>
      <div className="carousel-item">
        <img src="data:image/jpeg;base64," alt="Chicago" className="d-block" style={{width: '100%'}} />
      </div>
      <div className="carousel-item">
        <img src="data:image/jpeg;base64," alt="New York" className="d-block" style={{width: '100%'}} />
      </div>
    </div>
   
    <button className="carousel-control-prev" type="button" data-bs-target="#demo" data-bs-slide="prev">
      <span className="carousel-control-prev-icon" />
    </button>
    <button className="carousel-control-next" type="button" data-bs-target="#demo" data-bs-slide="next">
      <span className="carousel-control-next-icon" />
    </button>
  </div>
  <div className="container-fluid mt-3">
    <h3>Slider </h3>
    <p> This is best platform  for you </p>
  </div>
   </div>

  )
}

export default Home